function renderCharMapHTML(){html="hola";return html}function insertLink(url,title){pathArray=window.location.pathname.split("/");with(document){s="http://"+window.location.hostname;for(i=0;i<pathArray.length-1;i++)s+=pathArray[i]+"/"}tinyMCEPopup.execCommand("mceInsertContent",false,'<a href="'+url+'"><img src="'+s+'mfdwn.png" alt="'+title+'"></a>');if(tinyMCEPopup.isWindow)window.focus();tinyMCEPopup.editor.focus();tinyMCEPopup.close()}tinyMCEPopup.requireLangPack();tinyMCEPopup.onInit.add(function(){tinyMCEPopup.dom.setHTML("charmapView",renderCharMapHTML())})